import React, { useEffect, useState } from 'react';
import {
  Dialog, DialogTitle, DialogContent, DialogActions, Button, IconButton, TextField
} from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
import ArrowForwardIcon from '@mui/icons-material/ArrowForward';
import { getDarkFiberDetails, addDarkFiberDetail, editDarkFiberDetail, deleteDarkFiberDetail } from './api';

const defaultForm = {
  dwdm_wavelength: '',
  equipment: '',
  in_use: false,
  capex_cost_to_light: '',
};

function DarkFiberFormDialog({ open, onClose, onSubmit, initialData, mode }) {
  const [formData, setFormData] = useState(initialData || defaultForm);
  useEffect(() => {
    if (open) setFormData(initialData || defaultForm);
  }, [open, initialData]);
  return (
    <Dialog open={open} onClose={onClose} maxWidth="xs" fullWidth>
      <DialogTitle>{mode === 'add' ? 'Add' : 'Edit'} Dark Fiber Detail</DialogTitle>
      <DialogContent>
        <TextField
          label="DWDM Wavelength"
          value={formData.dwdm_wavelength}
          onChange={e => setFormData(f => ({ ...f, dwdm_wavelength: e.target.value }))}
          fullWidth
          sx={{ mb: 2 }}
          InputProps={{ style: { fontSize: '0.75rem' } }}
          InputLabelProps={{ style: { fontSize: '0.75rem' } }}
        />
        <TextField
          label="Equipment"
          value={formData.equipment}
          onChange={e => setFormData(f => ({ ...f, equipment: e.target.value }))}
          fullWidth
          sx={{ mb: 2 }}
          InputProps={{ style: { fontSize: '0.75rem' } }}
          InputLabelProps={{ style: { fontSize: '0.75rem' } }}
        />
        <TextField
          label="CAPEX Cost to Light"
          value={formData.capex_cost_to_light}
          onChange={e => setFormData(f => ({ ...f, capex_cost_to_light: e.target.value }))}
          type="number"
          fullWidth
          sx={{ mb: 2 }}
          InputProps={{ style: { fontSize: '0.75rem' } }}
          InputLabelProps={{ style: { fontSize: '0.75rem' } }}
        />
        <TextField
          label="In Use"
          value={formData.in_use ? 'Yes' : 'No'}
          fullWidth
          sx={{ mb: 2 }}
          InputProps={{ readOnly: true, style: { fontSize: '0.75rem' } }}
          InputLabelProps={{ style: { fontSize: '0.75rem' } }}
        />
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose}>Cancel</Button>
        <Button onClick={() => onSubmit(formData)} variant="contained">{mode === 'add' ? 'Add' : 'Save'}</Button>
      </DialogActions>
    </Dialog>
  );
}

function DarkFiberModal({ open, onClose, circuitId }) {
  const [rows, setRows] = useState([]);
  const [loading, setLoading] = useState(true);
  const [formOpen, setFormOpen] = useState(false);
  const [formMode, setFormMode] = useState('add');
  const [editId, setEditId] = useState(null);
  const [editRow, setEditRow] = useState(null);
  const [currentIndex, setCurrentIndex] = useState(0);

  const fetchRows = async () => {
    setLoading(true);
    const data = await getDarkFiberDetails(circuitId);
    setRows(data);
    setCurrentIndex(0);
    setLoading(false);
  };

  useEffect(() => {
    if (open && circuitId) fetchRows();
  }, [open, circuitId]);

  const handleAdd = () => {
    setFormMode('add');
    setEditRow(null);
    setFormOpen(true);
    setEditId(null);
  };
  const handleEdit = () => {
    setFormMode('edit');
    setEditRow(rows[currentIndex]);
    setEditId(rows[currentIndex]?.id);
    setFormOpen(true);
  };
  const handleDelete = async () => {
    await deleteDarkFiberDetail(rows[currentIndex]?.id);
    fetchRows();
  };
  const handleFormSubmit = async (formData) => {
    if (formMode === 'add') {
      await addDarkFiberDetail({ ...formData, circuit_id: circuitId });
    } else if (formMode === 'edit') {
      await editDarkFiberDetail(editId, formData);
    }
    setFormOpen(false);
    fetchRows();
  };

  const current = rows[currentIndex] || {};

  return (
    <Dialog open={open} onClose={onClose} maxWidth="xs" fullWidth>
      <DialogTitle>Dark Fiber Details for {circuitId}</DialogTitle>
      <DialogContent>
        {loading ? (
          <div>Loading...</div>
        ) : rows.length === 0 ? (
          <div>No details available.</div>
        ) : (
          <>
            <TextField
              label="DWDM Wavelength"
              value={current.dwdm_wavelength || ''}
              fullWidth
              sx={{ mb: 2 }}
              InputProps={{ readOnly: true, style: { fontSize: '0.75rem' } }}
              InputLabelProps={{ style: { fontSize: '0.75rem' } }}
            />
            <TextField
              label="Equipment"
              value={current.equipment || ''}
              fullWidth
              sx={{ mb: 2 }}
              InputProps={{ readOnly: true, style: { fontSize: '0.75rem' } }}
              InputLabelProps={{ style: { fontSize: '0.75rem' } }}
            />
            <TextField
              label="CAPEX Cost to Light"
              value={current.capex_cost_to_light || ''}
              fullWidth
              sx={{ mb: 2 }}
              InputProps={{ readOnly: true, style: { fontSize: '0.75rem' } }}
              InputLabelProps={{ style: { fontSize: '0.75rem' } }}
            />
            <TextField
              label="In Use"
              value={current.in_use ? 'Yes' : 'No'}
              fullWidth
              sx={{ mb: 2 }}
              InputProps={{ readOnly: true, style: { fontSize: '0.75rem' } }}
              InputLabelProps={{ style: { fontSize: '0.75rem' } }}
            />
            <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: 8 }}>
              <IconButton onClick={() => setCurrentIndex(i => Math.max(0, i - 1))} disabled={currentIndex === 0}><ArrowBackIcon /></IconButton>
              <span style={{ fontSize: '0.75rem' }}>{rows.length > 0 ? `Detail ${currentIndex + 1} of ${rows.length}` : ''}</span>
              <IconButton onClick={() => setCurrentIndex(i => Math.min(rows.length - 1, i + 1))} disabled={currentIndex === rows.length - 1}><ArrowForwardIcon /></IconButton>
            </div>
          </>
        )}
        <Button startIcon={<AddIcon />} onClick={handleAdd} sx={{ mt: 2, fontSize: '0.75rem' }}>Add</Button>
        {rows.length > 0 && <Button startIcon={<EditIcon />} onClick={handleEdit} sx={{ mt: 2, ml: 1, fontSize: '0.75rem' }}>Edit</Button>}
        {rows.length > 0 && <Button startIcon={<DeleteIcon />} onClick={handleDelete} sx={{ mt: 2, ml: 1, fontSize: '0.75rem' }} color="error">Delete</Button>}
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose} sx={{ fontSize: '0.75rem' }}>Close</Button>
      </DialogActions>
      <DarkFiberFormDialog
        key={formMode + (editId || 'add')}
        open={formOpen}
        onClose={() => setFormOpen(false)}
        onSubmit={handleFormSubmit}
        initialData={formMode === 'edit' ? editRow : defaultForm}
        mode={formMode}
      />
    </Dialog>
  );
}

export default DarkFiberModal;
